import React from 'react' 
import Select from '../UI/Select'

function UserActions(){
  const options=[
    {label:'cenas',value:'cenas'},
    {label:'cenas2',value:'cenas2'}
  ]
  return (
    <Select options={options} onChange={() => console.log('onChange')}/>
  )
}

export default UserActions
